import React from 'react';
import { createRoot } from 'react-dom/client';
import './index.css';
import TimelineBuilder from './TimelineBuilder';

const container = document.getElementById('root');
const root = createRoot(container);
root.render(
  <React.StrictMode>
    <TimelineBuilder />
  </React.StrictMode>
);
